function Cart() {
  return (
    <div>
      <div style={{ marginTop: "3%", textAlign: "center" }}>
        <div className="container">
          <div className="col1">
            <h6>Products</h6>
            <hr></hr>
            <div>
              <h5>test</h5>
            </div>
          </div>
          <div className="col2">
            <h6>Price</h6>
            <hr></hr>
            <div>
              <h5>test</h5>
            </div>
          </div>
          <div className="col3">
            <h6>Quantity</h6>
            <hr></hr>
            <div>
              <h5>test</h5>
            </div>
          </div>
          <div className="col4">
            <h6>Total</h6>
            <hr></hr>
            <div>
              <h5>100</h5>
            </div>
          </div>

          <div className="total">
            <form>
              <label>
                Copon:
                <input type="text" name="copon" />
              </label>
              <input type="submit" value="Submit" />
            </form>
            <h4>Total</h4>
            <hr></hr>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cart;

